package core

import "testing"

type sherlockStr struct {
	input    string
	expected string
}

var sherlockStrs = []sherlockStr{
	{"abcdefghhgfedecba", "YES"},
	{"aabbcd", "NO"},
	{"aabbccddeefghi", "NO"},
	{"aabbc", "YES"},
	{"", "YES"},
	{longStr, "YES"},
}

func TestSherlockStr(t *testing.T) {
	for _, test := range sherlockStrs {
		if got := SherlockStr(test.input); got != test.expected {
			t.Logf("input -> %s", test.input)
			t.Fatalf("test expected %s, got %s", test.expected, got)
		}
	}
}

var longStr = ""
